import React from "react";
import "./App.css";
import { useState } from "react"
function App() {
  const [numbr, setnumbr] = useState(1);
  const increaseNumbr = () => {

    setnumbr(numbr + 1);

  };

  return (
    <div className="App">
      <button onClick={increaseNumbr}>Increment</button>
      <h1>{numbr}</h1>
    </div>
  );
}

export default App;
